import logo from './logo.svg';
import './App.css';
import MyButton from './Components/Boton/Button';
import Navbar from './Components/Navbar/Navbar';

function MyOtherButton() {
  return (
    <button className='AppCssButton'>Segundo botón</button>
  );
}

function App() {
  return (
  <>
    <Navbar/>
    <h2>Boton importado de la carpeta Components.</h2>
    <MyButton/>
    <h2>Botón creado desde App.js</h2>
    <MyOtherButton />
  </>
);
}

export default App;
